import React from "react";

const BlogSingle = () => {
  return (
    <>
      <div className=" mt-20 bg-gray-200">
        <div className=" flex flex-col lg:flex-row p-10">
          <div className="w-full lg:w-2/3  bg-white mr-10">
            <img src="/images/demo.jpg" className="w-full brightness-75"></img>
          </div>
          <div className="lg:w-1/3  w-full bg-white h-screen"></div>
        </div>
      </div>
    </>
  );
};

export default BlogSingle;
